import Statistics from './Statistics'

function StatisticList({ stats }) {
  return (
    <ul>
      {stats.map((stat) => (
        <li key={stat.id}>
          <Statistics label={stat.label} stats={stat} />
        </li>
      ))}
    </ul>
  )
}

export default StatisticList
